import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./dashboard.css"; // Import CSS

const Dashboard = () => {
  const navigate = useNavigate();
  const [showAbout, setShowAbout] = useState(false);
  const [showDeveloper, setShowDeveloper] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="dashboard-container">
      {/* Navigation Bar */}
      <nav className="navbar">
        <h2>Dashboard</h2>
        <div className="nav-links">
          <button onClick={() => setShowAbout(!showAbout)}>About Dashboard</button>
          <button onClick={() => setShowDeveloper(!showDeveloper)}>About Developer</button>
          <button onClick={handleLogout} className="logout-btn">Logout</button>
        </div>
      </nav>

      {/* Full-Screen Power BI Dashboard */}
      <iframe
        title="Power BI Dashboard"
        className="dashboard-frame"
        src="https://app.powerbi.com/reportEmbed?reportId=ec54a816-3afc-4035-bd7e-a129f30ae980&autoAuth=true&ctid=ff335ba2-bb68-489a-bbdd-f49ab4319838"
        frameBorder="0"
        allowFullScreen={true}
      ></iframe>

      {/* About Dashboard Section */}
      {showAbout && (
        <div className="info-box">
          <h3>About Dashboard</h3>
          <p>This dashboard provides real-time analytics and insights using Power BI.</p>
        </div>
      )}

      {/* About Developer Section */}
      {showDeveloper && (
        <div className="info-box">
          <h3>About Developer</h3>
          <p>Developed by Shaik Mohammad Mujahiddin, a passionate software engineer.</p>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
